Приложение Красное&Белое — одна маленькая иконка, а столько полезных функций! Регистрируйся в удобном личном кабинете и ты сможешь:

• Узнать стоимость любого товара;
• Узнать об акциях и скидках;
• Определить местонахождение ближайшего магазина;
• Найти нужный товар, ознакомиться с его описанием и рейтингом;
• Проверить напитки на легальность по коду в чеке;
• Привязать дисконтную карту к смартфону и получать скидку;

